/* eslint-disable eqeqeq */
/* eslint-disable react-hooks/rules-of-hooks */
import React, { Component, useEffect, useState } from 'react'
import { useNavigate, Link } from 'react-router-dom';
import axios from 'axios';

import './login_style.css';

class Login extends Component {
render() {


    const history = useNavigate();

    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')

    async function submit(e){
        e.preventDefault();

        try{
            await axios.post("http://localhost:8000/register",{
                email,password
            })
            .then(res=>{
                if(res.data == "exist"){
                history("/home")
                }
                else if(res.data == "notexist"){
                    alert("User have not registered. Please try again")
                    }
            })
            .catch(e => {
                alert("Wrong Details")
                console.log(e)
            })
        }
        catch(e){

            console.log(e);
        }
    }

    return (
    <>

    <div className="container-fluid px-1 px-md-5 px-lg-1 px-xl-5 py-5 mx-auto">
        <div className="card card0 border-0">
            <div className="row d-flex">
                <div className="col-lg-6">
                    <div className="card1 pb-5">
                        <div className="row">
                            <img src="img/estracres.png" className="logo" alt=""/>
                        </div>
                        <div className="row px-3 justify-content-center mt-4 mb-5 border-line">
                            <img src="https://i.imgur.com/uNGdWHi.png" className="image" alt=""/>
                        </div>
                    </div>
                </div>
            <form method="post">
                <div className="col-lg-6">
                    <div className="card2 card border-0 px-4 py-5">
                        
                        <div className="row py-4 px-3 mb-4">
                            <div className="line"></div>
                            <div className="line"></div>
                        </div>
                        <div className="row px-3">
                            <label className="mb-1"><h6 className="mb-0 text-sm">Email Address</h6></label>
                            <input className="mb-4" type="text" name="email" placeholder="Enter a valid email address"
                            
                            onChange={(e)=>{ setEmail(e.target.value) }}/>
                        </div>
                        <div className="row px-3">
                            <label className="mb-1"><h6 className="mb-0 text-sm">Password</h6></label>
                            <input type="password" name="password" placeholder="Enter password"  onChange={(e)=>{ setPassword(e.target.value) }}/>
                        </div>
                        <div className="row px-3 mb-4">
                        <Link to="/" className="ml-auto mb-0 text-sm">Forgot Password?</Link>
                        </div>
                        <div className="row mb-3 px-3">
                            <button type="submit" className="btn btn-blue text-center" onClick={submit}>Login</button>
                        </div>
                        <div className="row mb-4 px-3">
                        <small className="font-weight-bold">Don't have an account? <Link to="/register" className="text-danger ">Register</Link></small>
                        </div>
                        <div className="row px-3 mb-4">
                            <div className="line"></div>
                            <div className="line"></div>
                        </div>
                    </div>
                </div>
            </form>
            </div>

            <div className="bg-blue py-3">
                <div className="row px-4 ">
                    <small className="ml-4 ml-sm-5 mb-2">Copyright &copy; 2023. All rights reserved.</small>
                </div>
            </div>
        </div>
    </div>



    
    </>
    )
}
}

export default Login
